      max-width: 30%;
      height: auto;
      cursor: pointer;
      transition: transform 0.1s ease;

    #cat:active {
      transform: scale(0.95);

    #emoji {
      font-size: 1.8rem;

<script>
    function formatNumber(num) {
      return num.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
    }

    let coins = parseInt(localStorage.getItem('tapcat_coins')) || 0;
    const counter = document.getElementById('count');
    const cat = document.getElementById('cat');

    function updateCounter() {
      counter.textContent = formatNumber(coins);
    }

    cat.addEventListener('click', () => {
      coins++;
      localStorage.setItem('tapcat_coins', coins);
      updateCounter();
    });

    updateCounter();
  </script>
